import React, {Component} from 'react';
import Task from "../task/task";
import TaskToggle from "../task-toogle/task-toggle";

const TaskListItem=({className, id, mainFunction, text})=> {

    

            const taskToogle =  <TaskToggle id={id} mainFunction={mainFunction}
                                            type="text" className="edit"
                                            value={text}/>


            return (
                <li className={className}>
                    <Task   text={text} className='view' mainFunction={mainFunction} mainClass={className} id={id}/>
                    {(className === 'editing') ? taskToogle: null}
                </li>
            )

}

